// LandingPage.js
import React from 'react';
import './LandingPage.css';
import cheeseburgerImage from './images/cheese-burger.png'

const LandingPage = ({ goToMenu }) => {
  return (
    <div className="landing-page">
      <div className="top-section">
        <img src={cheeseburgerImage} alt="header-image" className="header-image"/>
        <div className="content">
          <div className="logo-circle">
            <img src={cheeseburgerImage} alt="header-image" className="header-image"/>
          </div>

        </div>
      </div>


      <div className="landing-content">
        <section className="restaurant-info">
          <h2>ROOM 101</h2>
        </section>
        <section className="order-instructions">
          <button onClick={goToMenu} className="order-btn">
            Makan Di Tempat
          </button>
        </section>
      </div>
    </div>
  );
};

export default LandingPage;
